import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';
import DistrictInfo from './DistrictInfo';
import { proxyUrls } from '../utils/MapConfig';
import Chart from './Chart';
import Tabs from './Tabs';

const RowTwo = (props: IRowProps) => {

    const {
        color,
        height,
        padding
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <DistrictInfo
                            title='Wähle einen Stadtteil aus.'
                            defaultText='Auswählen...'
                            fetchUrl={proxyUrls[3]}
                        />
                    }
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                    padding: padding,
                }}
                    content={
                    <>
                    <Tabs>
                        <div >
                            See ya later, <em>Alligator</em>!
                        </div>
                        <div >
                            After 'while, <em>Crocodile</em>!
                        </div>
                        <div >
                            Nothing to see here, this tab is <em>extinct</em>!
                        </div>
                    </Tabs>
                    </>}
                // content={'Extending Volunteered Geographic Information (VGI) with Geospatial Software as a Service: Participatory Asset Mapping Infrastructures for Urban Health, geoserver credetials, postgres user, Diagramm Legende Karte, selected Features dynamischer,  sql injection, loading while fetching, Tabs diagramm switch gesamt stadtteil'}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <Chart
                            colors={['rgba(179,0,0,1)', 'rgba(40,150,0,1)']}
                        />
                    }
                />
            </div>
        </>
    )
}

export default RowTwo;
